// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";


contract MarketPlace is ReentrancyGuard{
    address public immutable  feeAccount;
    uint public feepercent;
    uint public itemCount;

    struct Item{
        uint itemId;
        IERC721 nft;
        uint tokenId;
        uint price;
        address payable seller;
        bool sold;
    }
    mapping (uint =>Item) public items;

    event Offered(
        uint itemId,
        address indexed nft,
        uint tokenId,
        uint price,
        address indexed seller
    );
    event Bought(
        uint itemId,
        address indexed nft,
        uint tokenId,
        uint price,
        address indexed seller,
        address indexed buyer
    );
    constructor(uint _feepercent){
        feepercent = _feepercent;
        feeAccount = payable(msg.sender);
    }

    function makeItem(IERC721 _nft, uint _tokenId, uint _price) external {
        require(_price>0,"Price must be greater than zero");
        itemCount++;
        _nft.transferFrom(msg.sender,address(this),_tokenId);
        items[itemCount] = Item(itemCount,_nft,_tokenId,_price,payable(msg.sender),false);
        emit Offered(itemCount,address(_nft),_tokenId,_price,msg.sender);

    }
    function purchaseItem(uint _itemId)external payable {
        uint _totalPrice = getTotalPrice(_itemId);
        Item storage item = items[_itemId];
        require(_itemId>0,"Item id invalid");
        require(msg.value>=_totalPrice,"Insufficient");
        require(!item.sold,"Already sold");
        item.seller.transfer(item.price);
        payable(feeAccount).transfer(_totalPrice-item.price);

        item.sold = true;
        //item.nft.transferFrom(address(this),msg.sender,item.tokenId);
        emit Bought(
            _itemId,
            address(item.nft),
            item.tokenId,
            item.price,
            item.seller,
            msg.sender
        );

    }
    function getTotalPrice(uint _itemId)view public returns(uint){
        return((items[_itemId].price*(100 + feepercent))/100);
    }

}

